import React from 'react';
import ReactDOM from 'react-dom';
import { Route, Link, NavLink ,BrowserRouter as Router, Switch } from 'react-router-dom'
import App from './app';
import Favorites from './favorites';
import ToWatch from './to-watch';
import Notfound from './page-404';
import './css/all.min.css';
import './css/fontawesome.min.css';
import './scss/App.scss';
// import './styles.css';

//https://api.themoviedb.org/3/movie/550?api_key=ccd60d653f56114f67fe5f13b2c82147
//https://api.themoviedb.org/3/list/10?api_key=ccd60d653f56114f67fe5f13b2c82147
//https://api.themoviedb.org/3/search/movie?query=avengers&api_key=ccd60d653f56114f67fe5f13b2c82147&page=2

const routing = (
  <Router>
    <nav>
      <ul>
        <li><NavLink exact to="/" activeClassName="active">Search</NavLink></li>
        <li><NavLink to="/favorites" activeClassName="active">Favorites</NavLink></li>
        <li><NavLink to="/towatch" activeClassName="active">To Watch</NavLink></li>
      </ul>
      <Switch>
        <Route exact path="/" component={App} />
        <Route path="/favorites" component={Favorites} />
        <Route path="/towatch" component={ToWatch} />
        <Route component={Notfound} />
      </Switch>
    </nav>
  </Router>
)

ReactDOM.render(routing, document.getElementById('root'));
